import React, { useState, useEffect } from 'react';
import { color, font } from '../../layout/main';

const Title = () => {
  const [queque, setQueque] = useState([]);
  useEffect(()=> {
    //const arr = Array(50).fill(0).map((WORD, i) => i % 2 === 0 ? '*' : "GREENPOST'S");
    const arr = Array(50).fill("GREENPOST'S");
    setQueque(arr);
  },[])
  return(
    <div>
      <ul>
        {
          queque.map((word, i) => i % 2 === 0 ? <li><span>{word}</span></li> : <li>{word}</li>)
        }
      </ul>
      <style jsx >{`
        ul{
          margin: 0;
          padding: 0;
          color: ${color.prim};
          display: flex;
          width: 150%;
          align-items: center;
        }
        li{
          flex-shrink: 0;
        }
        li span{
          line-height: 0;
        }
      `}
      </style>
    </div>
  )
}

const Main = () => {
  return(
    <div className="main">
      <Title />
    </div>
  )
}

export default Main;
